script: |
  super -f text -I q7523.spq | sort > q7523.out

inputs:
  - name: q7523.spq
    data: |
      SELECT DISTINCT - col1 + - cor0.col2 * + col2 AS col0 FROM tab1 (FORMAT parquet) cor0 WHERE - col0 NOT IN ( col0 + col1 * - col1 );
  - name: tab1

outputs:
  - name: q7523.out
    data: |
      -2942
      -3259
      -9229
